var test = require('tape'),
    extent = require('geojson-extent'),
    fs = require('fs'),
    queue = require('queue-async')
    geojsonCover = require('./');

test('bbox', function(t){
  var bbox = [0,0,1,1];

  t.ok(geojsonCover.bboxQueryIndexes(bbox), 'bbox indexes'); // -> cells
  t.ok(geojsonCover.bboxCellGeoJSON(bbox), 'bbox geojson'); // -> geojson
  t.end();
});

test('point', function(t) {
  var pt = {
      "type": "Feature",
      "properties": {},
      "geometry": {
        "type": "Point",
        "coordinates": [
          -93.416748046875,
          41.37680856570233
        ]
      }
    };

  t.ok(geojsonCover.geometryIndexes(pt).length, 'point indexes');
  t.end();
});

test('polygon', function(t) {
  var poly = {
      "type": "Feature",
      "properties": {},
      "geometry": {
        "type": "Polygon",
        "coordinates": [
          [
            [
              -93.328857421875,
              41.65649719441145
            ],
            [
              -96.712646484375,
              40.83043687764923
            ],
            [
              -95.108642578125,
              39.90130858574735
            ],
            [
              -93.328857421875,
              41.65649719441145
            ]
          ]
        ]
      }
    };

  t.ok(geojsonCover.geometryIndexes(poly).length, 'polygon indexes'); 
  t.ok(geojsonCover.geometryGeoJSON(poly), 'polygon geojson');
  t.equal(geojsonCover.geometryGeoJSON(poly).features[0].geometry.type, 'Polygon');
  t.end();
});

