test('World', function(t) {
  var world = JSON.parse(fs.readFileSync(__dirname + '/world.geojson'));

  var q = queue(1);

  world.features.forEach(function(feature){
    q.defer(function(done){
      t.ok(geojsonCover.geometryIndexes(feature).length, feature.properties.sovereignt+' geometry'); 
      t.ok(geojsonCover.geometryGeoJSON(feature), feature.properties.sovereignt+' geojson');
      t.equal(geojsonCover.geometryGeoJSON(feature).features[0].geometry.type, 'Polygon');
      done()
    })
  });

  q.awaitAll(function(err){
    if(err) t.fail(err)
    t.end()
  })
});

test('line', function(t){
  var line = JSON.parse(fs.readFileSync('./line.geojson'));
  
  t.ok(geojsonCover.geometryIndexes(line).length, 'LineString indexes');
  t.ok(geojsonCover.geometryGeoJSON(line).features.length, 'LineString geojson');
  t.equal(geojsonCover.geometryGeoJSON(line).features[0].geometry.type, 'Polygon');
  t.end()
});
